import React from "react";

const Header = () => {
  return (
    <header className="bg-[#402E7A] text-white py-6 shadow-md">
      <div className="container mx-auto flex justify-center items-center gap-4 mt-2  max-w-max">
        <svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 24 24"
          fill="white"
          className="w-10 h-10"
        >
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 19V6l12-2v13M9 10l12-2m-12 6v6" />
          </svg>
        <h1 className="text-4xl font-bold tracking-wide">FIZZ-BUZZ-BASS</h1>
      </div>
    </header>
  );
};

export default Header;
